import style from "./Header.module.css";
import load from "../../../Assets/Preloader/preloader.gif";
import { NavLink } from "react-router-dom";

function Header(props) {
  return (
    <header className={style.header}>
      <div className={style.profile_header}>
        <div className={style.title}>
          <div className={style.img}>
            <img height={30} width={30} src={load} alt=" " />
          </div>
          <div>GreenCosmic Study</div>
        </div>
      </div>
      <div className={style.workspace_header}></div>
      <div className={style.name_header}>
        <div className={style.buttons}>
          <NavLink to={"/courses"}>
            <div className={style.button}>
              <div className={style.text}>All Courses</div>
            </div>
          </NavLink>

          <div className={style.button}>
            {props.username !== "" && props.isAuth === true ? (
              <div className={style.nickName}>{"Hello " + props.username}</div>
            ) : (
              <div>
                <NavLink to={"/"}>
                  <div className={style.text}>Sign in</div>
                </NavLink>
              </div>
            )}
          </div>
        </div>
      </div>
    </header>
  );
}
export default Header;
